★ノースフェイスのモバイルポーチ！<br>
<br>
●スマートフォンを活用するランナーのためのキャリーポーチ！<br>
●幅広のベルトで上腕にフィットさせ、ストレッチ性がある素材のため負荷を最小限に抑えています。<br>
●フラップ部分にはイヤホンコードを通すことのできるスリット付き。<br>
●ミベルトの末端にはコインを入れられるポケットも付いているので、最低限の持ち物でスポーツを楽しむことが可能！<br>
●ジョギングやランニング、ジムでのトレーニング時など、身軽にスポーツを楽しみたい方にお勧めのモバイルポーチです。<br>
